import { useEffect, useState } from "react";
import api from "../api";
import "./House.css";

export default function Bookings() {
  const today = new Date().toISOString().split("T")[0];

  const [projects, setProjects] = useState([]);
  const [houses, setHouses] = useState([]);
  const [bookings, setBookings] = useState([]);
  const [loading, setLoading] = useState(false);

  const [form, setForm] = useState({
    projectId: "",
    houseNumber: "",
    customerName: "",
    mobileNo: "",
    paymentType: "cash",
    totalPayment: 0,
    advancePayment: 0,
    emiMonths: 0,
    emiAmount: 0,
    incompletePayment: 0,
    bookingDate: today,
  });

  /* ================= LOAD DATA ================= */
  useEffect(() => {
    loadProjects();
    loadBookings();
  }, []);

  const loadProjects = async () => {
    const res = await api.get("/lily");
    setProjects(res.data.data);
  };

  const loadBookings = async () => {
    const res = await api.get("/bookings");
    setBookings(res.data.data);
  };

  /* ================= PROJECT MAP ================= */
  const projectMap = {};
  projects.forEach(p => (projectMap[p.id] = p.projectName));

  /* ================= PROJECT CHANGE ================= */
  const handleProjectChange = async (pid) => {
    setForm(prev => ({
      ...prev,
      projectId: pid,
      houseNumber: "",
      totalPayment: 0,
      advancePayment: 0,
      emiMonths: 0,
      emiAmount: 0,
      incompletePayment: 0,
    }));

    const res = await api.get(`/lily/houses/${pid}`);
    setHouses(res.data.data.filter(h => h.status === "available"));
  };

  /* ================= HOUSE CHANGE ================= */
  const handleHouseChange = (houseNo) => {
    const house = houses.find(h => h.houseNumber === houseNo);
    const price = house?.price || 0;

    setForm(prev => ({
      ...prev,
      houseNumber: houseNo,
      totalPayment: price,
      advancePayment: prev.paymentType === "cash" ? price : 0,
      incompletePayment: prev.paymentType === "emi" ? price : 0,
    }));
  };

  /* ================= PAYMENT TYPE ================= */
  const handlePaymentType = (type) => {
    setForm(prev => ({
      ...prev,
      paymentType: type,
      advancePayment: type === "cash" ? prev.totalPayment : 0,
      emiMonths: 0,
      emiAmount: 0,
      incompletePayment: type === "cash" ? 0 : prev.totalPayment,
    }));
  };

  /* ================= ADVANCE ================= */
  const handleAdvance = (value) => {
    const advance = Number(value || 0);
    const pending = form.totalPayment - advance;

    setForm(prev => ({
      ...prev,
      advancePayment: advance,
      incompletePayment: pending,
      emiAmount:
        prev.emiMonths > 0 ? Math.ceil(pending / prev.emiMonths) : 0,
    }));
  };

  /* ================= EMI MONTHS ================= */
  const handleEmiMonths = (months) => {
    const m = Number(months || 0);
    const emi = m > 0
      ? Math.ceil(form.incompletePayment / m)
      : 0;

    setForm(prev => ({
      ...prev,
      emiMonths: m,
      emiAmount: emi,
    }));
  };

  /* ================= SUBMIT ================= */
  const submitBooking = async (e) => {
    e.preventDefault();
    setLoading(true);

    try {
      await api.post("/bookings/create", {
        ...form,
        projectId: Number(form.projectId),
      });

      alert("✅ Booking Created");
      setForm({
        projectId: "",
        houseNumber: "",
        customerName: "",
        mobileNo: "",
        paymentType: "cash",
        totalPayment: 0,
        advancePayment: 0,
        emiMonths: 0,
        emiAmount: 0,
        incompletePayment: 0,
        bookingDate: today,
      });

      setHouses([]);
      loadBookings();
    } catch (err) {
      alert(err.response?.data?.message || "❌ Booking Failed");
    } finally {
      setLoading(false);
    }
  };

  /* ================= UI ================= */
  return (
    <div className="booking-container">
      <h2>Create Booking</h2>

      <form onSubmit={submitBooking}>
        <select required value={form.projectId} onChange={e => handleProjectChange(e.target.value)}>
          <option value="">Select Project</option>
          {projects.map(p => (
            <option key={p.id} value={p.id}>{p.projectName}</option>
          ))}
        </select>

        <select required value={form.houseNumber} onChange={e => handleHouseChange(e.target.value)}>
          <option value="">Select House</option>
          {houses.map(h => (
            <option key={h.houseNumber} value={h.houseNumber}>{h.houseNumber}</option>
          ))}
        </select>

        <input required placeholder="Customer Name"
          value={form.customerName}
          onChange={e => setForm({ ...form, customerName: e.target.value })} />

        <input required placeholder="Mobile Number"
          value={form.mobileNo}
          onChange={e => setForm({ ...form, mobileNo: e.target.value })} />

        <select value={form.paymentType} onChange={e => handlePaymentType(e.target.value)}>
          <option value="cash">Cash</option>
          <option value="emi">EMI</option>
        </select>

        <input readOnly value={form.totalPayment} placeholder="Total Amount" />

        {form.paymentType === "emi" && (
          <>
            <input
              type="number"
              placeholder="Advance Payment"
              value={form.advancePayment}
              onChange={e => handleAdvance(e.target.value)}
            />

            <input
              type="number"
              placeholder="EMI Months"
              value={form.emiMonths}
              onChange={e => handleEmiMonths(e.target.value)}
            />

            <input readOnly placeholder="Monthly EMI" value={form.emiAmount} />
            <input readOnly placeholder="Pending Amount" value={form.incompletePayment} />
          </>
        )}

        <button disabled={loading}>
          {loading ? "Booking..." : "Book House"}
        </button>
      </form>

      <h2>Booking List</h2>

      <table>
        <thead>
          <tr>
            <th>ID</th>
            <th>Project</th>
            <th>House</th>
            <th>Customer</th>
            <th>Type</th>
            <th>Total</th>
            <th>Advance</th>
            <th>Pending</th>
          </tr>
        </thead>
        <tbody>
          {bookings.map(b => (
            <tr key={b._id}>
              <td>{b.bookingId}</td>
              <td>{projectMap[b.projectId]}</td>
              <td>{b.houseNumber}</td>
              <td>{b.customerName}</td>
              <td>{b.paymentType.toUpperCase()}</td>
              <td>₹{b.totalPayment}</td>
              <td>₹{b.advancePayment}</td>
              <td>{b.paymentType === "emi" ? `₹${b.incompletePayment}` : "Paid"}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}
